import './css/App.css';
import React from "react";
// import {render} from "react-dom";
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import Nav from './Nav';
//import {Router, Route} from "react-router";

import landing from "./Component/Landing";
import search from "./Component/Search";
import userX from "./Component/User";
import regist_P from "./Component/Search";
import log_in from "./Component/Log_in";
//import { AuthProvider } from './components/Auth';

function App() {
  return (
    <div className="App"> 
    <Nav />
      <Router>
        {/* <div className="App_Nav"> */}

        {/* </div> */}

        <div className="App_Body" >
          <div className='AppB'>              
              <Switch>
                  <Route path="/" exact component={landing} />
                  <Route path="/Landing" component={landing} />
                  <Route path="/Search" component={search} />
                  <Route path="/User" component={userX} />
                  <Route path="/Log_in" component={sign_P} />
                  <Route path="/Register" component={regist_P} />
              </Switch>
            </div>  
        </div>
      </Router>
    </div>
  );
}

export default App;
